import React from 'react';
import './App.css';
import Header from './Header.js';
import Technologies from './Technologies.js';
import Footer from './Footer.js';

const App = () => {
  return (
    <div className='app-wrapper'>
      <header className= 'header'>
        <img src='https://img.freepik.com/free-vector/bird-colorful-logo-gradient-vector_343694-1365.jpg?size=338&ext=jpg&ga=GA1.1.1413502914.1725235200&semt=ais_hybrid' />
      </header>
      <nav className= 'nav'>
        <div>
          <div className= 'home'>Home</div>&nbsp;&nbsp;
          <div className='about'>About</div>&nbsp;&nbsp;
          <div className='skills'>Skills</div>&nbsp;&nbsp;
          <div>Favourite</div>&nbsp;&nbsp;
          <div>Contact</div> 
        </div>
      </nav>
    </div>
  );
}

export default App;
